CREATE function [dbo].[f_SearchCustomer](@key text)
returns table
as 
return (SELECT RoomService.name as Room,Fname as [First Name],Lname as [ Last Name ],CMND,Sex,Phone,Address,DateCheckIn,DateCheckOut 
FROM Customer inner join RoomService on Customer.IDRoom = RoomService.id 
WHERE CONCAT(Fname, Lname, Address, Phone, CMND) LIKE @key);
GO
/****** Object:  UserDefinedFunction [dbo].[f_GetListMenuByRoom]    Script Date: 11/14/2021 10:54:05 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [dbo].[f_GetListMenuByRoom](@id int)
RETURNS TABLE
AS 
RETURN (SELECT dbo.Service.name, dbo.BillInfo.count, dbo.Service.price, dbo.Service.price * dbo.BillInfo.count AS TotalPrice
FROM dbo.Bill INNER JOIN
     dbo.BillInfo ON dbo.Bill.id = dbo.BillInfo.idBill INNER JOIN
     dbo.Service ON dbo.BillInfo.idService = dbo.Service.id
WHERE(dbo.Bill.status = 0 AND dbo.Bill.idRoom = @id))

GO
