CREATE FUNCTION [dbo].[f_FindCalendar](@id int)
RETURNS TABLE
AS 
RETURN(SELECT ID,Fname AS [First Name],Lname AS [Last Name],Type AS [Position],Shift,CONVERT(varchar,Date,101) AS [Date],Phone 
FROM calendar INNER JOIN Account ON calendar.ID=Account.UserID 
WHERE CONVERT(varchar,Date,101) >=CONVERT(varchar,GETDATE(),101) AND ID=@id)
GO
