CREATE FUNCTION [dbo].[f_getMyCalendar](@userID int)
RETURNS TABLE
AS
RETURN (SELECT Shift,CONVERT(varchar, Date,101) AS[Date] 
FROM calendar 
WHERE CONVERT(varchar,Date,101) >=CONVERT(varchar,GETDATE(),101) AND  ID=@userID)
