/****** Object:  UserDefinedFunction [dbo].[f_ShowReport]    Script Date: 11/14/2021 10:54:05 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [dbo].[f_ShowReport]()
RETURNS TABLE
AS
RETURN (SELECT  salary.UserID as [ID],
				Type as [Position],Lname AS Name,
				SUM((ABS(CAST(DATENAME(HOUR,CheckOut) AS int)-CAST(DATENAME(HOUR,CheckIn) AS int)) -ABS(ABS(CAST(DATENAME(HOUR,CheckOut) AS int)-CAST(DATENAME(HOUR,CheckIn) AS float))-8))) AS [Time(work-quit)],
				SUM(salary) AS [Salary] 
FROM account INNER JOIN salary ON account.UserID=salary.UserID WHERE CAST( GETDATE() AS Date ) =CAST(CheckOut AS date) 
GROUP BY salary.UserID , Type,Lname)
GO
/****** Object:  UserDefinedFunction [dbo].[f_ShowReportbyDate]    Script Date: 11/14/2021 10:54:05 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [dbo].[f_ShowReportbyDate](@date DATETIME)
RETURNS TABLE
AS
RETURN (SELECT  salary.UserID as [ID],
				Type as [Position],Lname AS Name,
				SUM((ABS(CAST(DATENAME(HOUR,CheckOut) AS int)-CAST(DATENAME(HOUR,CheckIn) AS int)) -ABS(ABS(CAST(DATENAME(HOUR,CheckOut) AS int)-CAST(DATENAME(HOUR,CheckIn) AS float))-8))) AS [Time(work-quit)],
				SUM(salary) AS [Salary] 
		FROM account INNER JOIN salary ON account.UserID=salary.UserID WHERE CAST(@date AS Date ) =CAST(CheckOut AS date) 
		GROUP BY salary.UserID , Type,Lname )
GO
