CREATE proc [dbo].[USP_Static]
@date1 date ,@date2 date 
as
begin
	SELECT  CAST(DateCheckOut AS DATE) as Date , Sum(totalPrice) as Price 
    FROM Bill  
    WHERE status = 1 and DateCheckOut >= @date1  and DateCheckOut <= @date2 
    GROUP BY CAST(DateCheckOut AS DATE) 
end
