CREATE PROC [dbo].[USP_TransactionCheckOut]
@idroom int ,@date datetime , @status int
AS
BEGIN
BEGIN TRY
BEGIN TRANSACTION
	update dbo.Customer
	set 
			DateCheckOut = @date,
			Status = @status
	WHERE IDRoom = @idroom

	update dbo.RoomService
	set [status]= N'Trống'
	WHERE id =@idroom
COMMIT TRANSACTION
END TRY
BEGIN CATCH
ROLLBACK TRANSACTION
END CATCH
END



GO
